import React from 'react'
import styled, { css } from 'styled-components'

export default function Button({text, func}) {
    return (
        <Container>
            <button onClick={func}>{text}</button>
        </Container>
    )
}

const Container = styled.button`
   ${props =>
    props.small &&
    css`
     width: 100px;
    `}; 
`
